    function sayHello() {
        alert("Hello");
    }
    return(
        <>
            <h1>Assignment 4</h1>
            <Add a={1} b={2}/>
            <ClickEvent/>
            <PassingDataOnEvent/>
            <PassingFunctions theFunction={sayHello()}/>
