            <BooleanStateVariables/>
            <StringStateVariables/>
            <DateStateVariables/>
            <ObjectStateVariable/>
            <ArrayStateVariable/>
            <ParentStateComponent/>
            <ReduxExamples/>
        </>
    );
};
export default Assignment4;
